import React from "react";

class ImageCard extends React.Component {
  render() {
    const { description, id, urls } = this.props.image;
    return (
      <div>
        <img
          src={urls.regular}
          alt={description}
          key={id}
          style={{ width: "250px" }}
        />
      </div>
    );
  }
}

export default ImageCard;
